(14, 'Sejarah IABHI', 'Sejarah', '{"data":[{"type":"heading","data":{"text":"Sejarah IABHI"}},{"type":"columns","data":{"columns":[{"width":6,"blocks":[{"type":"text","data":{"text":"Perkembangan industri jasa konstruksi di Indonesia berjalan seiring dan searah dengan perkembangan dunia yang disemangati oleh kepedulian akan keberlanjutan planet bumi. Keprihatinan dan kewaspadaan akan pemanasan global, perubahan iklim dan emisi karbon telah menuntun jasa konstruksi di seluruh dunia, termasuk Indonesia, untuk berorientasi dan mengimplementasikan bangunan hijau sebagai praktek tak terelakkan.\\n\\nPerencanaan, pelaksanaan dan pengoperasian bangunan hijau atau bangunan berkelanjutan merupakan salah satu bentuk kontribusi terhadap pemecahan masalah global seperti keterbatasan energi, kelangkaan air, keterbatasan ruang, yang menuntut peranan berbagai keahlian jasa konstruksi khususnya, untuk mengambil prakarsa dan kepemimpinan dalam gerakan peduli lingkungan ini.\\n\\nKeahlian tentang bangunan yang meliputi namun tidak terbatas pada ilmu dan teknologi bangunan, metoda dan material bangunan, manajemen dan pengoperasian bangunan ditambah sejumlah keahlian ekonomi bangunan, sosiologi penghuni dan pengetahuan\\\\-pengetahuan turunannya, merupakan sumber\\\\-sumber daya terpenting di negeri ini yang kekuatannya harus digalang dan potensinya disinergikan. Kesemuanya untuk menghasilkan bangunan yang hemat dalam pengoperasian, sehat, selamat, berkinerja terbaik secara teknis, ekologis dan ekonomis.\\n"}}]},{"width":6,"blocks":[{"type":"text","data":{"text":"Selanjutnya, untuk mengisi peran dan tanggung jawab profesional dalam mengurangi kerusakan lingkungan akibat bangunan gedung dalam setiap tahap daur hidup bangunan, maka perlu dilembagakan dalam suatu wadah perhimpunan yang dimaksudkan untuk mewujudkan peranan nyata dari para profesional ini, demi kehormatan bangsa Indonesia dan kemuliaan umat manusia se jagat. Himpunan ini akan mengorganisasikan semua upaya pendidikan, pelatihan, penelitian dan pengembangan ilmu dan pengetahuan serta optimasi sumber\\\\-sumber daya insani, alami maupun metodologi untuk dapat memberikan sumbangsih terbaiknya dalam bidang bangunan berkelanjutan.\\n\\nDengan menyadari pentingnya pembinaan dan pengembangan profesi, maka atas rahmat Tuhan Yang Maha Esa dan didasari oleh niat dan cita\\\\-cita yang luhur, maka dengan ini para ahli dan berbagai profesi berhimpun dalam wadah Ikatan Ahli Bangunan Hijau Indonesia \\\\(IABHI\\\\) yang sudah di bentuk sejak tanggal 10 April 2013 di Ibu Kota Negara Republik Indonesia – DKI Jakarta. IABHI merupakan wadah tunggal dimana terhimpun para ahli di bidang Bangunan Hijau Indonesia.\\n"}}]}],"preset":"columns-6-6"}}]}', '<h2>Sejarah IABHI</h2>\n<div class=''row''><div class=''col-md-6''><p>Perkembangan industri jasa konstruksi di Indonesia berjalan seiring dan searah dengan perkembangan dunia yang disemangati oleh kepedulian akan keberlanjutan planet bumi. Keprihatinan dan kewaspadaan akan pemanasan global, perubahan iklim dan emisi karbon telah menuntun jasa konstruksi di seluruh dunia, termasuk Indonesia, untuk berorientasi dan mengimplementasikan bangunan hijau sebagai praktek tak terelakkan.</p>\n\n<p>Perencanaan, pelaksanaan dan pengoperasian bangunan hijau atau bangunan berkelanjutan merupakan salah satu bentuk kontribusi terhadap pemecahan masalah global seperti keterbatasan energi, kelangkaan air, keterbatasan ruang, yang menuntut peranan berbagai keahlian jasa konstruksi khususnya, untuk mengambil prakarsa dan kepemimpinan dalam gerakan peduli lingkungan ini.</p>\n\n<p>Keahlian tentang bangunan yang meliputi namun tidak terbatas pada ilmu dan teknologi bangunan, metoda dan material bangunan, manajemen dan pengoperasian bangunan ditambah sejumlah keahlian ekonomi bangunan, sosiologi penghuni dan pengetahuan&#45;pengetahuan turunannya, merupakan sumber&#45;sumber daya terpenting di negeri ini yang kekuatannya harus digalang dan potensinya disinergikan. Kesemuanya untuk menghasilkan bangunan yang hemat dalam pengoperasian, sehat, selamat, berkinerja terbaik secara teknis, ekologis dan ekonomis.</p>\n</div><div class=''col-md-6''><p>Selanjutnya, untuk mengisi peran dan tanggung jawab profesional dalam mengurangi kerusakan lingkungan akibat bangunan gedung dalam setiap tahap daur hidup bangunan, maka perlu dilembagakan dalam suatu wadah perhimpunan yang dimaksudkan untuk mewujudkan peranan nyata dari para profesional ini, demi kehormatan bangsa Indonesia dan kemuliaan umat manusia se jagat. Himpunan ini akan mengorganisasikan semua upaya pendidikan, pelatihan, penelitian dan pengembangan ilmu dan pengetahuan serta optimasi sumber&#45;sumber daya insani, alami maupun metodologi untuk dapat memberikan sumbangsih terbaiknya dalam bidang bangunan berkelanjutan.</p>\n\n<p>Dengan menyadari pentingnya pembinaan dan pengembangan profesi, maka atas rahmat Tuhan Yang Maha Esa dan didasari oleh niat dan cita&#45;cita yang luhur, maka dengan ini para ahli dan berbagai profesi berhimpun dalam wadah Ikatan Ahli Bangunan Hijau Indonesia &#40;IABHI&#41; yang sudah di bentuk sejak tanggal 10 April 2013 di Ibu Kota Negara Republik Indonesia – DKI Jakarta. IABHI merupakan wadah tunggal dimana terhimpun para ahli di bidang Bangunan Hijau Indonesia.</p>\n</div></div>', '{"data":[{"type":"image_extended","data":{"file":{"url":"http://beta.iabhi.or.id/images/Picture3.jpg","filename":"Picture3.jpg"},"caption":"","source":""}}]}', '<img class="img-responsive" src="http://beta.iabhi.or.id/images/Picture3.jpg" alt="" />\n', '2016-04-03 20:11:36'),
(15, 'Keanggotaan', 'Keanggotaan', '{"data":[{"type":"heading","data":{"text":"Keanggotaan IABHI"}},{"type":"columns","data":{"columns":[{"width":6,"blocks":[{"type":"text","data":{"text":"I. PERSYARATAN KEANGGOTAAN\\n"}},{"type":"text","data":{"text":"**Anggota Biasa :**\\n"}},{"type":"list","data":{"text":" - Warga Negara Republik Indonesia yang memiliki ijazah ditetapkan.\\n - Warga Negara Republik Indonesia yang memiliki ijazah pendidikan tinggi setara dengan jenjang program sarjana \\\\(strata 1\\\\) dalam bidang ilmu teknik dan ilmu lain sesuai bidang keahlian yang diperoleh dari lembaga pendidikan tinggi yang terakreditasi, mempunyai pengalaman kerja di bidang Bangunan Gedung minimum 2 \\\\(dua\\\\) tahun dan memenuhi persyaratan IABHI yang ditetapkan.\\n"}},{"type":"text","data":{"text":"**Anggota Praktisi** :\\n"}},{"type":"list","data":{"text":" - Seseorang yang memiliki ijazah setara dengan jenjang Sarjana Muda/Diploma dalam bidang Bangunan Gedung yang diperoleh dari lembaga pendidikan tinggi yang terakreditasi, mempunyai pengalaman kerja di bidang Bangunan Gedung minimum 5 \\\\(lima\\\\) tahun dan memenuhi \\\\- persyaratan IABHI yang ditetapkan.\\n - Seseorang yang memiliki ijazah pendidikan tinggi setara dengan jenjang program sarjana \\\\(strata 1\\\\) dalam bidang ilmu teknik dan ilmu lain sesuai bidang keahlian yang diperoleh dari lembaga pendidikan tinggi yang terakreditasi, mempunyai pengalaman kerja di bidang Bangunan Gedung \\\\-minimum 2 \\\\(dua\\\\) tahun dan memenuhi persyaratan IABHI yang ditetapkan.\\n"}},{"type":"text","data":{"text":"**Anggota Muda :**\\n"}},{"type":"list","data":{"text":" - Mahasiswa yang sedang belajar pada program studi bidang Bangunan Gedung, bidang teknologi dan bidang keahlian lain pada lembaga pendidikan yang terakreditasi dan memenuhi persyaratan IABHI yang ditetapkan.\\n - Perubahan status anggota Muda menjadi anggota Biasa dapat dilakukan melalui Rapat Pengurus Pusat dan/atau melalui rekomendasi Komisariat Daerah.\\n"}},{"type":"text","data":{"text":"**Anggota Kehormatan :**\\n"}},{"type":"list","data":{"text":" - Seseorang yang diangkat oleh IABHI karena dinilai sangat berjasa dalam bidang penyelenggaraan bangunan dan memenuhi persyaratan IABHI yang ditetapkan.\\n - Anggota Kehormatan adalah seorang tokoh nasional atau pakar di bidang penyelenggaraan bangunan atau seseorang yang mempunyai jabatan penting di bidang penyelenggaraan bangunan Hijau.\\n"}}]},{"width":6,"blocks":[{"type":"text","data":{"text":"II. MANFAAT DAN HAK ANGGOTA\\n"}},{"type":"text","data":{"text":"**Anggota Biasa berhak :**\\n"}},{"type":"list","data":{"text":" - Untuk dipilih atau memilih badan pengurus.\\n\\n - Memberikan suara dalam pemungutan suara.\\n - Mengemukakan pendapat baik secara lisan maupun tertulis sesuai ketentuan yang berlaku\\n - Memperoleh kesempatan mengikuti semua aktivitas IABHI\\n - Memperoleh pembinaan bagi peningkatan pengetahuan dan mutu profesionalnya serta kesejahteraannya.\\n - Memperoleh semua informasi kegiatan organisasi IABHI\\n - Mengikuti program Sertifikasi Keahlian Bangunan Hijau\\n - Memperoleh perlindungan dan pembelaan dalam melakukan tugas profesionalnya sepanjang tidak bertentangan atau melannggar ketentuan dan peraturan/perundangan yang berlaku.\\n"}},{"type":"text","data":{"text":"**Setiap Anggota Praktisi berhak :**\\n"}},{"type":"list","data":{"text":" - Untuk dipilih atau memilih badan pengurus.\\n\\n - Memberikan suara dalam pemungutan suara.\\n - Mengemukakan pendapat baik secara lisan maupun tertulis sesuai ketentuan yang berlaku\\n - Memperoleh kesempatan mengikuti semua aktivitas IABHI\\n - Memperoleh pembinaan bagi peningkatan pengetahuan dan mutu profesionalnya serta kesejahteraannya\\n - Memperoleh semua informs kegiatan organisasi IABHI\\n - Mengikuti program Sertifikasi Keahlian Bangunan Hijau\\n - Memperoleh perlindungan dan pembelaan dalam melakukan tugas profesionalnya sepanjang tidak bertentangan atau melannggar ketentuan dan peraturan/perundangan yang berlaku.\\n"}},{"type":"text","data":{"text":"**Setiap Anggota Muda berhak :**\\n"}},{"type":"list","data":{"text":" - Mengemukakan pendapat baik secara lisan maupun tertulis sesuai ketentuan yang berlaku.\\n\\n - Memperoleh kesempatan mengikuti aktivitas IABHI yang ditujukan untuknya.\\n - Memperoleh semua informasi kegiatan organisasi IABHI.\\n - Memperoleh dukungan yang diperlukan untuk menyelenggarakan aktivitas resmi yang diperlukan demi \\\\- kemajuan organisasi IABHI.\\n"}},{"type":"text","data":{"text":"**Setiap Anggota Kehormatan berhak :**\\n"}},{"type":"list","data":{"text":" - Mengemukakan pendapat baik secara lisan maupun tertulis sesuai ketentuan yang berlaku.\\n\\n - Memperoleh kesempatan mengikuti aktivitas IABHI yang ditujukan untuknya.\\n - Memperoleh semua informasi kegiatan organisasi IABHI\\n - Memperoleh dukungan yang diperlukan untuk menyelenggarakan aktivitas resmi yang diperlukan demi \\\\- kemajuan organisasi IABHI.\\n"}}]}],"preset":"columns-6-6"}}]}', '<h2>Keanggotaan IABHI</h2>\n<div class=''row''><div class=''col-md-6''><p>I. PERSYARATAN KEANGGOTAAN</p>\n<p><strong>Anggota Biasa :</strong></p>\n<ul>\n<li>Warga Negara Republik Indonesia yang memiliki ijazah ditetapkan.</li>\n<li>Warga Negara Republik Indonesia yang memiliki ijazah pendidikan tinggi setara dengan jenjang program sarjana &#40;strata 1&#41; dalam bidang ilmu teknik dan ilmu lain sesuai bidang keahlian yang diperoleh dari lembaga pendidikan tinggi yang terakreditasi, mempunyai pengalaman kerja di bidang Bangunan Gedung minimum 2 &#40;dua&#41; tahun dan memenuhi persyaratan IABHI yang ditetapkan.</li>\n</ul>\n<p><strong>Anggota Praktisi</strong> :</p>\n<ul>\n<li>Seseorang yang memiliki ijazah setara dengan jenjang Sarjana Muda/Diploma dalam bidang Bangunan Gedung yang diperoleh dari lembaga pendidikan tinggi yang terakreditasi, mempunyai pengalaman kerja di bidang Bangunan Gedung minimum 5 &#40;lima&#41; tahun dan memenuhi &#45; persyaratan IABHI yang ditetapkan.</li>\n<li>Seseorang yang memiliki ijazah pendidikan tinggi setara dengan jenjang program sarjana &#40;strata 1&#41; dalam bidang ilmu teknik dan ilmu lain sesuai bidang keahlian yang diperoleh dari lembaga pendidikan tinggi yang terakreditasi, mempunyai pengalaman kerja di bidang Bangunan Gedung &#45;minimum 2 &#40;dua&#41; tahun dan memenuhi persyaratan IABHI yang ditetapkan.</li>\n</ul>\n<p><strong>Anggota Muda :</strong></p>\n<ul>\n<li>Mahasiswa yang sedang belajar pada program studi bidang Bangunan Gedung, bidang teknologi dan bidang keahlian lain pada lembaga pendidikan yang terakreditasi dan memenuhi persyaratan IABHI yang ditetapkan.</li>\n<li>Perubahan status anggota Muda menjadi anggota Biasa dapat dilakukan melalui Rapat Pengurus Pusat dan/atau melalui rekomendasi Komisariat Daerah.</li>\n</ul>\n<p><strong>Anggota Kehormatan :</strong></p>\n<ul>\n<li>Seseorang yang diangkat oleh IABHI karena dinilai sangat berjasa dalam bidang penyelenggaraan bangunan dan memenuhi persyaratan IABHI yang ditetapkan.</li>\n<li>Anggota Kehormatan adalah seorang tokoh nasional atau pakar di bidang penyelenggaraan bangunan atau seseorang yang mempunyai jabatan penting di bidang penyelenggaraan bangunan Hijau.</li>\n</ul>\n</div><div class=''col-md-6''><p>II. MANFAAT DAN HAK ANGGOTA</p>\n<p><strong>Anggota Biasa berhak :</strong></p>\n<ul>\n<li><p>Untuk dipilih atau memilih badan pengurus.</p></li>\n<li><p>Memberikan suara dalam pemungutan suara.</p></li>\n<li>Mengemukakan pendapat baik secara lisan maupun tertulis sesuai ketentuan yang berlaku</li>\n<li>Memperoleh kesempatan mengikuti semua aktivitas IABHI</li>\n<li>Memperoleh pembinaan bagi peningkatan pengetahuan dan mutu profesionalnya serta kesejahteraannya.</li>\n<li>Memperoleh semua informasi kegiatan organisasi IABHI</li>\n<li>Mengikuti program Sertifikasi Keahlian Bangunan Hijau</li>\n<li>Memperoleh perlindungan dan pembelaan dalam melakukan tugas profesionalnya sepanjang tidak bertentangan atau melannggar ketentuan dan peraturan/perundangan yang berlaku.</li>\n</ul>\n<p><strong>Setiap Anggota Praktisi berhak :</strong></p>\n<ul>\n<li><p>Untuk dipilih atau memilih badan pengurus.</p></li>\n<li><p>Memberikan suara dalam pemungutan suara.</p></li>\n<li>Mengemukakan pendapat baik secara lisan maupun tertulis sesuai ketentuan yang berlaku</li>\n<li>Memperoleh kesempatan mengikuti semua aktivitas IABHI</li>\n<li>Memperoleh pembinaan bagi peningkatan pengetahuan dan mutu profesionalnya serta kesejahteraannya</li>\n<li>Memperoleh semua informs kegiatan organisasi IABHI</li>\n<li>Mengikuti program Sertifikasi Keahlian Bangunan Hijau</li>\n<li>Memperoleh perlindungan dan pembelaan dalam melakukan tugas profesionalnya sepanjang tidak bertentangan atau melannggar ketentuan dan peraturan/perundangan yang berlaku.</li>\n</ul>\n<p><strong>Setiap Anggota Muda berhak :</strong></p>\n<ul>\n<li><p>Mengemukakan pendapat baik secara lisan maupun tertulis sesuai ketentuan yang berlaku.</p></li>\n<li><p>Memperoleh kesempatan mengikuti aktivitas IABHI yang ditujukan untuknya.</p></li>\n<li>Memperoleh semua informasi kegiatan organisasi IABHI.</li>\n<li>Memperoleh dukungan yang diperlukan untuk menyelenggarakan aktivitas resmi yang diperlukan demi &#45; kemajuan organisasi IABHI.</li>\n</ul>\n<p><strong>Setiap Anggota Kehormatan berhak :</strong></p>\n<ul>\n<li><p>Mengemukakan pendapat baik secara lisan maupun tertulis sesuai ketentuan yang berlaku.</p></li>\n<li><p>Memperoleh kesempatan mengikuti aktivitas IABHI yang ditujukan untuknya.</p></li>\n<li>Memperoleh semua informasi kegiatan organisasi IABHI</li>\n<li>Memperoleh dukungan yang diperlukan untuk menyelenggarakan aktivitas resmi yang diperlukan demi &#45; kemajuan organisasi IABHI.</li>\n</ul>\n</div></div>', '', '', '2016-04-03 21:28:41'),
(9, 'Hubungi Kami', 'Hubungi Kami', '{"data":[{"type":"heading","data":{"text":"**Ikatan Ahli Bangunan Hijau Indonesia**"}},{"type":"columns","data":{"columns":[{"width":6,"blocks":[{"type":"text","data":{"text":"Jakarta Design Center, Lt. 6, Ruang. H\\n\\nJl. Gatot Subroto Kav. 53\\n\\nSlipi\\\\-Jakarta 10260\\n\\n\\\\(P\\\\) 021\\\\-574 2384\\n\\n\\\\(F\\\\) 021\\\\-574 2385\\n\\n\\\\(E\\\\) info@iabhi.or.id | www.iabhi.or.id\\n"}}]},{"width":6,"blocks":[]}],"preset":"columns-6-6"}}]}', '<h2><strong>Ikatan Ahli Bangunan Hijau Indonesia</strong></h2>\r\n<div class=''row''><div class=''col-md-6''><p>Jakarta Design Center, Lt. 6, Ruang. H<br/>\r\nJl. Gatot Subroto Kav. 53<br/>\r\nSlipi&#45;Jakarta 10260<br/>\r\n&#40;P&#41; 021&#45;574 2384<br/>\r\n&#40;F&#41; 021&#45;574 2385<br/>\r\n&#40;E&#41; info@iabhi.or.id | www.iabhi.or.id</p>\r\n</div><div class=''col-md-6''></div></div>', '{"data":[{"type":"image_extended","data":{"file":{"url":"http://beta.iabhi.or.id/images/Picture3.jpg","filename":"Picture3.jpg"},"caption":"","source":""}}]}', '<img class="img-responsive" src="http://beta.iabhi.or.id/images/Picture3.jpg" alt="" />\r\n', '2014-11-03 18:54:54'),
(10, 'Artikel', 'Artikel', '', '', '', '', '2014-12-02 13:47:20'),
(11, 'Profile of IABHI', 'Profil', '{"data":[{"type":"columns","data":{"columns":[{"width":6,"blocks":[{"type":"heading","data":{"text":"Profil"}},{"type":"text","data":{"text":"**Azas**\\n\\n**IABHI** berazaskan Pancasila dan berlandaskan Undang Undang Dasar 1945 \\\\(seribu sembilan ratus empat puluh lima\\\\).\\n\\n**Tujuan** \\n\\nIABHI bertujuan untuk meningkatkan dan mengembangkan mutu keahlian bangunan hijau, membangun kerjasama serta menjunjung profesionalisme dalam berkarya, sedemikian rupa sehingga masyarakat pengguna jasa mendapatkan kinerja terbaik.\\n\\n**Fungsi** \\n\\nIABHI berfungsi sebagai wadah komunikasi, konsultasi, koordinasi dan pembinaan serta pemersatu antar para ahli Bangunan Hijau dan / atau dengan tenaga ahli / professional lainnya dan/atau lembaga/institusi swasta/pemerintah baik nasional maupun internasional.\\n\\n**Tugas dan Kegiatan**\\n\\n1. Meningkatkan kemampuan dan kesejahteraan para ahli bangunan hijau\\n\\n2. Mengembangkan bidang  Bangunan Hijau sebagai ilmu dan profesi yang bermanfaat\\nbagi masyarakat luas dan lingkungan hidup pada umumnya, serta pengguna jasa pada khususnya.\\n\\n3. Mengadakan hubungan dan kerjasama yang harmonis dan saling menguntungkan antar para ahli  Bangunan Hijau, dengan tenaga ahli/professional lainnya, dan dengan lembaga/instansi yang dikelola oleh masyarakat, swasta dan pemerintah, baik di tingkat nasional maupun internasional.\\n\\n4. Melaksanakan berbagai kegiatan dalam bentuk layanan informasi, layanan teknis, pendidikan profesi, pelatihan dan layanan masyarakat serta pemanfaatan teknologi.\\n\\n5. Meningkatkan serta mengembangkan peran serta para ahli  Bangunan Hijau dalam proses penyelenggaraan bangunan dan kawasannya, seperti pelaksanaan Sertifikasi Keahlian Bangunan Hijau bagi para anggotanya.\\n\\n"}}]},{"width":6,"blocks":[{"type":"heading","data":{"text":"Arti Logo\\n"}},{"type":"image_extended","data":{"file":{"url":"http://beta.iabhi.or.id/images/logoIABHI.png","filename":"logoIABHI.png"},"caption":"","source":""}},{"type":"text","data":{"text":"Logo **IKATAN AHLI BANGUNAN HIJAU INDONESIA \\\\(IABHI\\\\)** mempunyai dasar bentuk rotasi daun sebagai simbol keberlanjutan. Warna gradasi dari muda ke yang tua melambangkan kedewasaan. Diharapkan, keberadaan IABHI menjadikan peran profesional/ahli bangunan hijau dapat mematangkan posisinya sebagai duta dalam keberlanjutan.\\n"}}]}],"preset":"columns-6-6"}}]}', '<div class=''row''><div class=''col-md-6''><h2>Profil</h2>\n<p><strong>Azas</strong></p>\n\n<p><strong>IABHI</strong> berazaskan Pancasila dan berlandaskan Undang Undang Dasar 1945 &#40;seribu sembilan ratus empat puluh lima&#41;.</p>\n\n<p><strong>Tujuan</strong> </p>\n\n<p>IABHI bertujuan untuk meningkatkan dan mengembangkan mutu keahlian bangunan hijau, membangun kerjasama serta menjunjung profesionalisme dalam berkarya, sedemikian rupa sehingga masyarakat pengguna jasa mendapatkan kinerja terbaik.</p>\n\n<p><strong>Fungsi</strong> </p>\n\n<p>IABHI berfungsi sebagai wadah komunikasi, konsultasi, koordinasi dan pembinaan serta pemersatu antar para ahli Bangunan Hijau dan / atau dengan tenaga ahli / professional lainnya dan/atau lembaga/institusi swasta/pemerintah baik nasional maupun internasional.</p>\n\n<p><strong>Tugas dan Kegiatan</strong></p>\n\n<ol>\n<li><p>Meningkatkan kemampuan dan kesejahteraan para ahli bangunan hijau</p></li>\n<li><p>Mengembangkan bidang  Bangunan Hijau sebagai ilmu dan profesi yang bermanfaat\nbagi masyarakat luas dan lingkungan hidup pada umumnya, serta pengguna jasa pada khususnya.</p></li>\n<li><p>Mengadakan hubungan dan kerjasama yang harmonis dan saling menguntungkan antar para ahli  Bangunan Hijau, dengan tenaga ahli/professional lainnya, dan dengan lembaga/instansi yang dikelola oleh masyarakat, swasta dan pemerintah, baik di tingkat nasional maupun internasional.</p></li>\n<li><p>Melaksanakan berbagai kegiatan dalam bentuk layanan informasi, layanan teknis, pendidikan profesi, pelatihan dan layanan masyarakat serta pemanfaatan teknologi.</p></li>\n<li><p>Meningkatkan serta mengembangkan peran serta para ahli  Bangunan Hijau dalam proses penyelenggaraan bangunan dan kawasannya, seperti pelaksanaan Sertifikasi Keahlian Bangunan Hijau bagi para anggotanya.</p></li>\n</ol>\n</div><div class=''col-md-6''><h2>Arti Logo</h2>\n<img class="img-responsive text-center" src="http://beta.iabhi.or.id/images/logoIABHI.png" alt="" />\n<p>Logo <strong>IKATAN AHLI BANGUNAN HIJAU INDONESIA &#40;IABHI&#41;</strong> mempunyai dasar bentuk rotasi daun sebagai simbol keberlanjutan. Warna gradasi dari muda ke yang tua melambangkan kedewasaan. Diharapkan, keberadaan IABHI menjadikan peran profesional/ahli bangunan hijau dapat mematangkan posisinya sebagai duta dalam keberlanjutan.</p>\n</div></div>', '', '', '2016-03-21 17:32:20'),
(12, 'Struktur Organisasi', 'Struktur', '{"data":[{"type":"heading","data":{"text":"Struktur Kepengurusan Periode 2015\\\\-2018"}},{"type":"image_extended","data":{"file":{"url":"http://beta.iabhi.or.id/images/StrukturIABHI.png","filename":"StrukturIABHI.png"},"caption":"","source":""}},{"type":"columns","data":{"columns":[{"width":6,"blocks":[{"type":"heading","data":{"text":"Dewan Pengawas\\n"}},{"type":"text","data":{"text":"**Dewan Pengawas Periode 2015\\\\-2018** \\n\\n**_Ketua Dewan Pengawas_ :** \\nAgus Sudjadi Tjokrorahardjo\\n\\nJimmy Siswanto Juwana\\n\\nRana Yusuf Nasir\\n\\nTimmy Setiawan Tjahya\\n\\nAnton Suhardianto\\n\\nMoch. Herman Endro\\n"}}]},{"width":6,"blocks":[{"type":"heading","data":{"text":"Dewan Pengurus\\n"}},{"type":"text","data":{"text":"**Dewan Pengurus Periode 2015\\\\-2018** \\n\\n_**Ketua Umum**_ **:** \\nIwan Prijanto\\n\\n_**Wakil Ketua Umum**_**:**\\nBintang Nugroho\\n\\n_**Sekretaris**_ **:**\\nDian Fitria\\n\\n**_Wakil Sekretaris :_**\\nNur Rifka\\n\\n_**Bendahara**_ **:**\\nAni Isdiati Gunawan\\n\\n**Susunan Bidang Kepengurusan :**\\n\\n_**I. Bidang Pelayanan Keanggotaan**_\\n\\n_**Ketua I**_ :\\nYodi Danu Sastro\\n\\n_**Mentor I**_ :\\nWawan Setiawan\\n\\n_**II. Bidang Pelatihan Pengembangan Keahlian**_\\n\\n_**Ketua II**_ : \\nYanu Aryani\\n\\n_**Mentor II**_ :\\nTrisomo\\n\\n_**III. Bidang Promosi dan Kerjasama Strategis**_\\n\\n_**Ketua III**_ : \\nHermiza Yeni Agvira\\n\\n_**Mentor III**_ :\\nTotok Sulistiyanto\\n"}}]}],"preset":"columns-6-6"}}]}', '<h2>Struktur Kepengurusan Periode 2015&#45;2018</h2>\n<img class="img-responsive" src="http://beta.iabhi.or.id/images/StrukturIABHI.png" alt="" />\n<div class=''row''><div class=''col-md-6''><h2>Dewan Pengawas</h2>\n<p><strong>Dewan Pengawas Periode 2015&#45;2018</strong> </p>\n\n<p><strong><em>Ketua Dewan Pengawas</em> :</strong> \nAgus Sudjadi Tjokrorahardjo</p>\n\n<p>Jimmy Siswanto Juwana</p>\n\n<p>Rana Yusuf Nasir</p>\n\n<p>Timmy Setiawan Tjahya</p>\n\n<p>Anton Suhardianto</p>\n\n<p>Moch. Herman Endro</p>\n</div><div class=''col-md-6''><h2>Dewan Pengurus</h2>\n<p><strong>Dewan Pengurus Periode 2015&#45;2018</strong> </p>\n\n<p><em><strong>Ketua Umum</strong></em> <strong>:</strong> \nIwan Prijanto</p>\n\n<p><em><strong>Wakil Ketua Umum</strong></em><strong>:</strong>\nBintang Nugroho</p>\n\n<p><em><strong>Sekretaris</strong></em> <strong>:</strong>\nDian Fitria</p>\n\n<p><strong><em>Wakil Sekretaris :</em></strong>\nNur Rifka</p>\n\n<p><em><strong>Bendahara</strong></em> <strong>:</strong>\nAni Isdiati Gunawan</p>\n\n<p><strong>Susunan Bidang Kepengurusan :</strong></p>\n\n<p><em><strong>I. Bidang Pelayanan Keanggotaan</strong></em></p>\n\n<p><em><strong>Ketua I</strong></em> :\nYodi Danu Sastro</p>\n\n<p><em><strong>Mentor I</strong></em> :\nWawan Setiawan</p>\n\n<p><em><strong>II. Bidang Pelatihan Pengembangan Keahlian</strong></em></p>\n\n<p><em><strong>Ketua II</strong></em> : \nYanu Aryani</p>\n\n<p><em><strong>Mentor II</strong></em> :\nTrisomo</p>\n\n<p><em><strong>III. Bidang Promosi dan Kerjasama Strategis</strong></em></p>\n\n<p><em><strong>Ketua III</strong></em> : \nHermiza Yeni Agvira</p>\n\n<p><em><strong>Mentor III</strong></em> :\nTotok Sulistiyanto</p>\n</div></div>', '', '', '2016-03-21 19:00:13'),
