INSERT INTO `tlc_post` (`postID`, `postURL`, `postTitle`, `postExcerpt`, `postContentHTML`, `postContent`, `postImage`, `postUserID`, `categoryID`, `datePosted`, `unixStamp`) VALUES
(14, 'pembukaan-pendaftaran-anggota', 'IABHI dan Pembukaan Pendaftaran Anggota', 'untuk para ahli bangunan hijau di Indonesia yang telah berbadan hukum, IABHI mengajak para ahli/profesional dalam bangunan hijau yang merupakan WNI untuk mendaftar sebagai anggota', '<p>Sebagai asosiasi profesi untuk para ahli bangunan hijau di Indonesia yang telah berbadan hukum, IABHI mengajak para ahli/profesional dalam bangunan hijau yang merupakan WNI untuk mendaftar sebagai anggota.</p>\n\n<p>Undangan ini berlaku juga untuk kalangan mahasiswa  dibidang bangunan gedung dan memiliki ketertarikan dengan isu bangunan hijau.</p>\n\n<p>Pendaftaran akan segera dibuka yang  langkah awalnya dapat dimulai dengan mengisi biodata pribadi melalui website IABHI , www.iabhi.or.id</p>\n', '{"data":[{"type":"text","data":{"text":"Sebagai asosiasi profesi untuk para ahli bangunan hijau di Indonesia yang telah berbadan hukum, IABHI mengajak para ahli/profesional dalam bangunan hijau yang merupakan WNI untuk mendaftar sebagai anggota.\\n\\nUndangan ini berlaku juga untuk kalangan mahasiswa  dibidang bangunan gedung dan memiliki ketertarikan dengan isu bangunan hijau.\\n\\nPendaftaran akan segera dibuka yang  langkah awalnya dapat dimulai dengan mengisi biodata pribadi melalui website IABHI , www.iabhi.or.id\\n\\n"}}]}', 'daftar.png', 10, 6, '03/30/2016 04:16:17', 1459286177),
(15, 'atasi-permasalahan-jalur-pejalan-kaki-dinas-bina-marga-dki-jakarta-adakan-program-lokakarya-bersama-holcim-indonesia', 'Atasi permasalahan jalur pejalan kaki, Dinas Bina Marga DKI Jakarta adakan program lokakarya bersama Holcim Indonesia', 'Mengembalikan fungsi utama jalur pejalan kaki yang semakin berkurang ', '<img class="img-responsive" src="http://beta.iabhi.or.id/images/Berita-IABHI(001).jpg" alt="" />\n<p><strong>Jakarta, 2 Februari 2016</strong> – Mengembalikan fungsi utama jalur pejalan kaki yang semakin berkurang dan tidak sesuai peruntukkannya seiring perkembangan dan dinamika kota besar seperti Jakarta, menjadi fokus Pemprov DKI Jakarta dalam lokakarya bersama Ikatan Ahli Bangungan Hijau Indonesia &#40;IABHI&#41;, Urban Guerrilla dan Holcim Indonesia, Selasa, 2 Februari 2016 di Gedung Dinas Teknis DKI Jakarta, Jati Baru, Jakarta. </p>\n\n<p>Acara yang dihadiri oleh Basuki Tjahaja Purnama, Gubernur DKI Jakarta, Ir. Yusmada Faizal, Kepala Dinas Bina Marga DKI Jakarta, Kepala Dinas Penataan Kota, Kepala Dinas Perhubungan dan Transportasi, Kepala Dinas Pertamanan dan Pemakaman, Kepala Dinas Tata Air, Kepala Dinas Badan Perencanaan Pembangunan Daerah, Kepala Dinas Perindustrian dan Energi, Kepala Dinas Pariwisata dan Kebudayaan, Kepala Dinas Perumahan dan Gedung Pemerintah Daerah Kepala Dinas Koperasi Usaha Mikro, Kecil dan Menengah serta perwakilan instansi&#45;instansi terkait lainnya di lingkungan Pemprov DKI Jakarta, serta perwakilan manajemen Holcim Indonesia, bertujuan untuk meningkatkan kualitas jalur pedestrian serta penekanan atas pentingnya membangun Kota Jakarta yang manusiawi dan ramah pejalan kaki. </p>\n\n<p>“Kami terus berupaya memberikan pelayanan yang lebih baik untuk setiap lapisan masyarakat. Selain pembangunan serta perbaikan sarana infrastruktur, kami juga ingin mengembalikan jalur pedestrian ke fungsinya semula. Lokakarya ini memberi ruang bagi segenap pemangku kepentingan dalam menganalisa kebutuhan, kondisi, maupun program saat ini, usulan konsep&#45;konsep penanganannya di masa mendatang yang sesuai dengan kondisi dan karakter Kota Jakarta agar dapat lebih optimal dirasakan hasilnya oleh masyarakat”, ujar Yusmada Faizal. </p>\n\n<p>Dalam acara ini, setiap peserta diberikan kesempatan untuk saling bertukar pikiran dan pendapat melalui berbagai topik sehingga dapat merubah cara pandang sebagian kita selama ini yang melihat pedestrian sebagai satu sistem mandiri bukan bagian sistem yang utuh di dalam jaringan konektivitas kota Jakarta. Melalui lokakarya ini, Pemprov DKI Jakarta mengharapkan dapat menemukan inovasi ataupun terobosan sebagai solusi yang paling sesuai untuk diimplementasikan di Jakarta dalam peningkatan kualitas salah satu pelayanan fasilitas umum bagi masyarakat. Melalui  lokakarya ini, Pemerintah DKI Jakarta diharapkan dapat menemukan solusi untuk mengatasi permasalahan yang terjadi serta meningkatkan pelayanan fasilitas umum bagi masyarakat. </p>\n\n<p>“Kami sangat mendukung dan siap membantu Pemerintah dalam menyediakan sarana infrastruktur yang sesuai dan bermanfaat bagi masyarakat. Melalui berbagai jenis solusi seperti perbaikan jalan dalam waktu 7 jam &#45; SpeedCrete™ &#45; serta solusi perkerasan beton untuk mencegah timbulnya genangan air di permukaan – ThruCrete &#45;, kami terus berupaya untuk menjadi salah satu alternatif solusi yang tepat untuk menjawab tantangan perubahan global yang sedemikian dinamis, khususnya didalam pengembangan perkotaan yang berkelanjutan”, kata Derek Williamson, Direktur PT Holcim Indonesia Tbk. </p>\n\n<p><strong><em>Tentang PT Holcim Indonesia Tbk</em></strong></p>\n\n<p><em>PT Holcim Indonesia Tbk &#40;Holcim Indonesia&#41; adalah sebuah perusahaan publik Indonesia dimana mayoritas sahamnya &#40;80,65%&#41; dimiliki dan dikelola oleh LafargeHolcim Group, yang berbasis di Swiss, produsen semen terbesar di dunia dengan total lebih dari 115,000 karyawan dan beroperasi di lebih dari 90 negara di seluruh benua.</em></p>\n\n<p><em>Sebagai salah satu perusahaan semen terbesar di Indonesia, PT Holcim Indonesia Tbk menjalankanusaha yang terintegrasi terdiri dari semen, beton siap pakai, dan produksi agregat. Perusahaan mengoperasikan tiga pabrik semen masing&#45;masing di Narogong, Jawa Barat, di Cilacap, Jawa Tengah, Tuban di Jawa Timur dan fasilitas penggilingan semen di Ciwandan, Banten dengan total kapasitas gabungan per tahun 12.5juta ton semen, dan mempekerjakan lebih dari 2,000 orang.</em></p>\n\n<p><em>PT Holcim Indonesia Tbk saat ini mengoperasikan jaringan penyedia bahan bangunan terbesar di dalam negeri, yang mencakup distributor khusus, toko bangunan, ahli bangunan binaan Holcim dan solusi&#45;solusi bernilai tambah lainnya.</em></p>\n\n<p><strong><em>Informasi lengkap dapat diperoleh dari:</em></strong></p>\n<div class=''row''><div class=''col-md-6''><p><em>Diah Sasanawati &#40;Anna&#41;</em></p>\n\n<p><em><strong>Corporate CommunicationsManager</strong></em></p>\n\n<p><em>PT Holcim Indonesia Tbk</em></p>\n\n<p><em>Phone : 62 21 2986 1000 ext 8361</em></p>\n\n<p><em>Mobile : 0813&#45;8181 8554</em></p>\n\n<p><em>e&#45;mail :</em> <em>diah.sasanawati@lafargeholcim.com</em></p>\n</div><div class=''col-md-6''><p><em>Ian Rolando Ferdinandus</em></p>\n\n<p><em><strong>Media Relations &amp; Digital Communications</strong></em></p>\n\n<p><em>PT Holcim Indonesia Tbk</em></p>\n\n<p><em>Phone: 62 21 823 1260 ext 5700</em></p>\n\n<p><em>Mobile: 0818 103 196</em></p>\n\n<p><em>e&#45;mail: ian.ferdinandus@lafargeholcim.com</em></p>\n</div></div>', '{"data":[{"type":"image_extended","data":{"file":{"url":"http://beta.iabhi.or.id/images/Berita-IABHI(001).jpg","filename":"Berita-IABHI(001).jpg"},"caption":"","source":""}},{"type":"text","data":{"text":"**Jakarta, 2 Februari 2016** – Mengembalikan fungsi utama jalur pejalan kaki yang semakin berkurang dan tidak sesuai peruntukkannya seiring perkembangan dan dinamika kota besar seperti Jakarta, menjadi fokus Pemprov DKI Jakarta dalam lokakarya bersama Ikatan Ahl