(13, 'IABHI-telah-Berbadan-Hukum', 'IABHI telah Berbadan Hukum', 'Pada tanggal 13 Agustus 2014 IABHI telah berbadan hukum berdasarkan Keutusan Menteri Hukum dan Hak Asasi Manusia Republik Indonesia', '<p>Pada tanggal 13 Agustus 2014 IABHI telah berbadan hukum berdasarkan Keutusan Menteri Hukum dan Hak Asasi Manusia Republik Indonesia No AHU&#45;00387.60.10.2014 tentang Pengesahan Pendirian Badan Hukum Perkumpulan Ikatan Ahli Bangunan Hijau Indonesia.</p>\n<img class="img-responsive" src="http://beta.iabhi.or.id/images/Picture1.jpg" alt="" />\n<img class="img-responsive" src="http://beta.iabhi.or.id/images/Picture2.jpg" alt="" />\n', '{"data":[{"type":"text","data":{"text":"Pada tanggal 13 Agustus 2014 IABHI telah berbadan hukum berdasarkan Keutusan Menteri Hukum dan Hak Asasi Manusia Republik Indonesia No AHU\\\\-00387.60.10.2014 tentang Pengesahan Pendirian Badan Hukum Perkumpulan Ikatan Ahli Bangunan Hijau Indonesia.\\n"}},{"type":"image_extended","data":{"file":{"url":"http://beta.iabhi.or.id/images/Picture1.jpg","filename":"Picture1.jpg"},"caption":"","source":""}},{"type":"image_extended","data":{"file":{"url":"http://beta.iabhi.or.id/images/Picture2.jpg","filename":"Picture2.jpg"},"caption":"","source":""}}]}', 'badan-hukum.jpg', 10, 7, '03/30/2016 04:09:22', 1459285762);
